import React from 'react';
import '../css/Home.css';
import '../css/Bootstrap.css';


class Home extends React.Component{
  renderPanels(buttonTitle, image){
    document.body.style = 'background: #40627d;';
    return(
      <div className="col-md panel">
        <div>
          <img className="icon" src={require(`${image}`)} />
        </div>
        <button type="button" className="btn btn-primary btn-lg button">{buttonTitle}</button>
      </div>
    );
  }

  render(){
    return(
        <div className="container">
          <div className="page-header">
            <h1 className="title">Concussion Competencies</h1>
            <h5 className="title"> <small> A FRAMEWORK FOR SCHOOL-BASED CONCUSSION MANAGEMENT</small></h5>
          </div>
          <div className="row row align-items-center">
            {this.renderPanels('Learn More', '../img/notebook.png')}
            {this.renderPanels('Blog', '../img/blog.png')}
            {this.renderPanels('Contact Us', '../img/mail.png')}
          </div>
        </div>
    );
  };
}

export default Home;
